import { useNavigate } from 'react-router-dom'
 
function Login(){
    const navigate = useNavigate();
    const handleLogin = async (e) => {
        e.preventDefault();
        navigate('/');
    }
    return (
        <div className='Container'>
            <form onSubmit={handleLogin}>
                <h1>Login</h1>
                
                <button type="submit">Login</button>
            </form>
            
        </div>
    )
}
export default Login
